import { Link } from "react-router-dom";
import React from "react";
import MedianCol from "./images/MedianCol.png";


function Header() {
    return (
        <header style={{
            height: "200px", backgroundColor: "gray",
        }}>


            <nav>
                <div className="container">
                    <div>
                        <div></div>
                        <div className="container">

                            <div className="row">
                                <div className="col-sm-3">

                                    <img src={MedianCol} alt="app logo" />
                                </div>
                                <div className="col-sm-7"></div>
                                <div className="col-sm-2 mr-2">
                                    <Link to="/home">MedianCOL </Link>
                                </div>
                                <div className="col-sm-1 mr-2"><Link to="/projects"> About</Link></div>
                                <div className="col-sm-1"><Link to="/Contact"> LivingCost</Link></div>

                            </div>

                        </div>
                    </div>
                </div>

            </nav>
        </header>
    )
}

export default Header;
